History Documentary hosted by Paul McGann, published by ITV in 2013 - English narration


Information
------------------------------

Brady and Hindley: Possession
This documentary to mark the 50th anniversary of the first of the Moors Murders raises new questions about a case whose impact continues to be felt. Ian Brady and Myra Hindley's horrific child killing spree shocked the nation and they have been front page news ever since. Ian Brady fantasised about committing the perfect murder. He wanted to keep possession of his victims - dark secrets in shallow graves on the moors above Manchester. The programme includes Myra Hindley's version of events, recorded from a prison cell, and heard for the first time. It also reveals the photographic system that Ian Brady used to celebrate the killings. Do these photographs suggest a new, secret burial site and could they hold the key to finding the grave of 12-year-old Keith Bennett, still missing after half a century?

